import { useContext, useRef, useState, useEffect } from 'react';
import { Link, useNavigate } from 'react-router-dom';
import axios from 'axios';


export default function RecordList() {
    const [users, setMenuData] = useState([]);
    
    const setIt = () => {
        axios.get("http://localhost:5000/menu/bank")
        .then(response => {
            setMenuData({ menus: response.data })
          })
          .catch((error) => {
            console.log(error);
    })
}

  return (
    <div>
      {setIt}
    </div>
  )
}
